import { useState } from "react";

const SingleUser = ({ user }) => {
  return (
    <div
      className="user"
      style={{ backgroundColor: user.gender === "Female" ? "pink" : "blue" }}
    >
      <img src={user.image} alt="" />
      <h1>{user.name}</h1>
    </div>
  );
};

export default SingleUser;
